import React,{ useState, useEffect } from "react";
import "../styling/seasonPage.css"

function SeasonTile(){

    const [year, setYear] = useState('');

    useEffect(
        () => {
          const fetchYear = async () => {
            const response = await fetch(`http://localhost:8081/dashboard/allSeasons`);
            const data = await response.json();
            setYear(data);
          }

        fetchYear();

        }, [year]
      );

      if(!year){return null}

    return(
        <div>
            <h1>Seasons</h1>

            {year.map(y => <p>{y}</p>)}

        </div>
    );
}

export default SeasonTile;
